  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0138177 includes physical
  and underway data collected aboard the ROGER REVELLE during cruise RR1203 in the
  Indian Ocean and Philippine Sea from 2012-04-09 to 2012-04-21. These data include
  CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT
  (V). The instruments used to collect these data include ADCP and GPS. These data
  were collected by Bruce Appelgate of University of California - San Diego; Scripps
  Institution of Oceanography as part of Transit. The Lamont-Doherty Earth Observatory
  (LDEO) submitted these data to NODC as part of the NSF sponsored Rolling Deck to
  Repository (R2R) program.nnThe ADCP data represent the raw and automated processed
  data set. Post processed quality assessed data are not available in this accession.\",\n\t\"owner_org\":
